import logE from './logE';

// 预警数据上报
export default function logR(key: string, value: number = 1, logData: any = {}, tagArray: any = []) {
    logE(50001, {
        key,
        value,
        logData,
        tagArray,
    });
    logE('appBusiness', {
        key,
        value,
        logData,
        tagArray,
    });
}
